/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div dir="${ifDefined(context.effectiveDir)}" class="${classMap(context.classes.wrapper)}"><span id="${ifDefined(context._id)}-hiddenText" class="ui5-hidden-text">${ifDefined(context.tokenizerLabel)}</span><div class="${classMap(context.classes.content)}" @ui5-delete="${ifDefined(context._tokenDelete)}" @click="${context._click}" @mousedown="${context._onmousedown}" @keydown="${context._onkeydown}" role="listbox" aria-labelledby="${ifDefined(context._id)}-hiddenText">${ repeat(context.tokens, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</div>${ context.showNMore ? block2(context) : undefined }</div>`; };
const block1 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>`; };
const block2 = (context) => { return html`<span @click="${context._openOverflowPopover}" class="ui5-tokenizer-more-text">${ifDefined(context._nMoreText)}</span>`; };


	return block0(context);
};

export default main;
